=head1 DESCRIPTION

The optional filter to narrow the C<ListServiceDeployment> results.

If you do not specify a value, service deployments that were created
before the current time are included in the result.

=head1 ATTRIBUTES


=head2 After => Str

Include service deployments in the result that were created after this
time. The format is yyyy-MM-dd HH:mm:ss.SSSSSS.


=head2 Before => Str

Include service deployments in the result that were created before this
time. The format is yyyy-MM-dd HH:mm:ss.SSSSSS.



